{u'category': 18, u'times_viewed': 1108, u'description': u'No me molesta en absoluto que no guste mi foto, pero que sentido tiene el boton: "I don\'t like this photo", solo trae malestar hacia todos los que mostramos publicamente nuestras fotografias. \r\nLas personas que hacen esto, amparados en el anonimato, solo demuestran su cobardia y envidia al no comentar, ni siquiera, el motivo de dicha actitud. \r\nS\xe9 que hay personas que piensan lo mismo que yo y, es por este motivo que, RUEGO A LOS ADMINISTRADORES QUE TOMEN ALGUNA MEDIDA AL RESPECTO. \r\nMi desprecio hacia todas aquellas personas que act\xfaan en la cobardia.\r\nUn saludo a todos. \r\nPD: no se como pero me parece que me he dado cuenta de quien me ha votado en negativo, pues ha tenido n fallo garrafal. Buen finde a todos', u'rating': 98.4, u'favorites_count': 97, u'created_at': u'2012-07-14T04:51:42-04:00', u'privacy': False, u'image_url': u'http://pcdn.500px.net/9733863/9b90efd6bf56d1cb8ad8ba34395dc204379ce698/2.jpg', u'nsfw': False, u'height': 3507, u'width': 2480, u'votes_count': 183, u'user': {u'username': u'Aleandro', u'city': u'San Roque ', u'userpic_url': u'http://acdn.500px.net/735047/a9f19ae56823e67ede25857bbae6e02e7f2aa332/1.jpg?127', u'firstname': u'Alejandro ', u'lastname': u'Ferrer Ruiz ', u'upgrade_status': 1, u'country': u'Cadiz', u'fullname': u'Alejandro  Ferrer Ruiz ', u'id': 735047}, u'comments_count': 133, u'id': 9733863, u'name': u'Mariquita '},
